import Button, { ButtonProps } from "@mui/material/Button";

interface ICustomButton extends ButtonProps {
  option: "hide" | "disable" | "enable";
  text?: string;
  variant?: "text" | "outlined" | "contained";
  color?: "inherit" | "primary" | "secondary" | "error";
  loading?: boolean;
  onClick?: () => void;
}

export const CustomButton = ({ children, ...props }: ICustomButton) => {
  return (
    <Button variant={variant} {...props}>
      {children}
    </Button>
  );
};
